import React from 'react';
import { motion } from 'framer-motion';

interface Experience {
  title: string;
  company: string;
  period: string;
  description: string[];
  technologies: string[];
}

const experiences: Experience[] = [
  {
    title: 'Senior Data Scientist',
    company: 'TechInnovate Solutions',
    period: '2023 - Present',
    description: [
      'Lead a team of data scientists working on AI-driven analytics solutions',
      'Implemented advanced machine learning models improving prediction accuracy by 35%',
      'Designed and deployed end-to-end data pipelines for real-time analytics',
      'Collaborated with stakeholders to translate business requirements into technical solutions'
    ],
    technologies: ['Python', 'TensorFlow', 'AWS', 'Docker', 'Big Data']
  },
  {
    title: 'Data Engineer',
    company: 'DataFlow Systems',
    period: '2022 - 2023',
    description: [
      'Architected scalable data infrastructure handling 5TB+ of daily data',
      'Developed ETL processes streamlining data integration across multiple sources',
      'Built interactive dashboards for real-time business intelligence',
      'Optimized database queries resulting in 40% performance improvement'
    ],
    technologies: ['Apache Spark', 'Kubernetes', 'SQL', 'Airflow', 'Snowflake']
  },
  {
    title: 'Data Analyst',
    company: 'Centre for Strategic and Contemporary Research (CSCR)',
    period: '2021 - 2022',
    description: [
      'Led data-driven research initiatives analyzing complex geopolitical and economic trends',
      'Developed custom data visualization solutions for research publications',
      'Implemented machine learning models for predictive analysis',
      'Created interactive dashboards visualizing research findings for policy makers'
    ],
    technologies: ['Python', 'Power BI', 'Machine Learning', 'Data Visualization']
  },
  {
    title: 'Data Research Intern',
    company: 'Pantellica',
    period: '2020 - 2021',
    description: [
      'Conducted comprehensive data analysis for market research projects',
      'Built automated data collection and processing pipelines',
      'Created statistical models for trend analysis',
      'Collaborated with cross-functional teams on data-driven solutions'
    ],
    technologies: ['Python', 'R', 'Statistical Analysis', 'Data Modeling']
  }
];

const ExperienceSection: React.FC = () => {
  return (
    <section id="experience" className="py-20 relative">
      <div className="absolute inset-0 bg-neutral/5" />
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
        className="container mx-auto px-4 relative"
      >
        <h2 className="text-4xl font-heading font-bold text-secondary mb-16">Work Experience</h2>

        <div className="relative">
          {/* Timeline line */}
          <div className="absolute left-8 md:left-1/2 h-full w-0.5 bg-secondary/20 transform -translate-x-1/2" />

          {experiences.map((exp, index) => (
            <motion.div
              key={exp.title}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.2 }}
              viewport={{ once: true, margin: "-100px" }}
              className={`relative grid grid-cols-1 md:grid-cols-2 gap-8 mb-16 last:mb-0 ${
                index % 2 === 0 ? 'md:text-right' : 'md:text-left md:flex-row-reverse'
              }`}
            >
              {/* Timeline dot */}
              <div className="absolute left-8 md:left-1/2 w-4 h-4 bg-secondary rounded-full transform -translate-x-1/2 mt-2">
                <div className="absolute inset-0 bg-secondary/20 rounded-full animate-ping" />
              </div>

              {/* Content */}
              <div className={`ml-16 md:ml-0 ${index % 2 === 0 ? 'md:pr-16' : 'md:pl-16 md:col-start-2'}`}>
                <motion.div
                  whileHover={{ scale: 1.02 }}
                  className="bg-neutral/10 p-6 rounded-lg backdrop-blur-sm border border-neutral/10 hover:border-secondary/20 transition-all duration-300"
                >
                  <div className="mb-4">
                    <h3 className="text-2xl font-heading font-bold text-secondary">{exp.title}</h3>
                    <p className="text-neutral-light">{exp.company}</p>
                    <p className="text-neutral font-mono">{exp.period}</p>
                  </div>

                  <ul className="space-y-3 text-neutral-light mb-4">
                    {exp.description.map((item, i) => (
                      <motion.li
                        key={i}
                        initial={{ opacity: 0, x: index % 2 === 0 ? 20 : -20 }}
                        whileInView={{ opacity: 1, x: 0 }}
                        transition={{ duration: 0.3, delay: i * 0.1 }}
                        viewport={{ once: true }}
                        className="flex items-start gap-2"
                      >
                        <span className="text-secondary mt-1.5">▹</span>
                        <span>{item}</span>
                      </motion.li>
                    ))}
                  </ul>

                  <div className="flex flex-wrap gap-2">
                    {exp.technologies.map((tech) => (
                      <motion.span
                        key={tech}
                        whileHover={{ scale: 1.05 }}
                        className="px-3 py-1 bg-secondary/5 text-secondary rounded-full text-sm border border-secondary/10 hover:border-secondary/30 transition-colors"
                      >
                        {tech}
                      </motion.span>
                    ))}
                  </div>
                </motion.div>
              </div>
            </motion.div>
          ))}
        </div>
      </motion.div>
    </section>
  );
};

export default ExperienceSection;
